import React from "react";
import { FC } from "react";
import Form from 'react-bootstrap/Form'
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import { ContactInfo } from '../../api/domain/contact-info'

export interface ContactInfoProps { 
contactInfo: ContactInfo;
}



export const ContactInfoForm: FC = ({contactInfo}) => {




    return(
        <div className="form__container">
            <h2>Контакты</h2>
        <Form>
        <Form.Group as={Row} controlId="formHorizontalEmail">
          <Form.Label column sm={2}>
            Электронная почта
          </Form.Label>
          <Col sm={10}>
            <Form.Control type="email" placeholder="Email"   value={contactInfo.email}/>
          </Col>
        </Form.Group>
        <Form.Group as={Row} controlId="formHorizontalPhone">
          <Form.Label column sm={2}>
            Телефон
          </Form.Label>
          <Col sm={10}>
            <Form.Control type="phone" placeholder="Phone"   value={contactInfo.phone}/>
          </Col>
        </Form.Group>
        </Form>
        </div>
    )

    }
